import React from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';

// Trang đầu tiên với nút để điều hướng
function HomePage() {
  const navigate = useNavigate(); // Hook để điều hướng

  const goToOtherPage = () => {
    navigate('/other-page'); // Điều hướng đến trang khác
  };

  return (
    <div>
      <h1>Trang chính</h1>
      <button onClick={goToOtherPage}>Đi đến trang khác</button>
    </div>
  );
}

// Trang khác sẽ được hiển thị khi bấm nút
function OtherPage() {
  return (
    <div>
      <h1>Trang khác</h1>
      <p>Đây là nội dung của trang khác.</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/other-page" element={<OtherPage />} />
      </Routes>
    </Router>
  );
}

export default App;
